import React from 'react';
import produto from './R.jpeg'
import { styled } from 'styled-components';

const produtoImg = styled.img`
  width:60px;
  height:100px

`;

export function Produto  ({ className,corte }) {

  return (

        <produtoImg                            
          value={corte}
          onChange={(event) => {
            setCorte(event);
          }}
          className={className} 
          src={produto} 
          alt={produto}
        />
  )}
